import React, { Component } from "react";
import Jumbotron from "../components/Jumbotron";
import Nav from "../components/nav";

function Home() {
    return (
        <div className="container container-fluid">
            <Nav />
            <Jumbotron>
                <h1
                    className="Display-4"
                >
                    Menu Ville
             </h1>
            </Jumbotron>
        </div>
    );
}

export default Home;
